import React, { useState } from 'react'

export default function Counter() {
    const [data,setCounter]=useState('0')
    const startcounter=()=>{
      setCounter(data+1);
    }
  return (
    <div style={{marginTop:'50px'}}>
        <h1>{data}</h1>
      <button type='button' onClick={startcounter}>Counter</button>
    </div>
  )
}
